import './ExpenseItem.css'
const expenseDate = new Date(2021, 2, 28);
const expenseTitle = "Seguro do Carro";
const expenseAmount = 287.96

//como "class" é uma palavra reservada em JS, usamos "className" para nomear as classes 
function ExpenseItem() {
  return (
    <div className='expense-item'>
      <div>28 de Março de 2022</div>
      <div className='expense-item__description'>
        <h2>Seguro do Carro</h2> 
        <div className='expense-item__price'>R$287,96</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
